import React, { Component } from "react";

class main extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: "",
      age: "",
    };
  }

  changeName = (event) => {
    this.setState({ name: event.target.value })
  }

  changeAge = (event) => {
    this.setState({ age: event.target.value })
  }

  render() {
    return (
      <div>
        <label>Name</label>
        <input></input>
      </div>
    );
  }
}

export default main;
